function formatSize(size) {
    return size.megabytes === 0 ? '< 0.1 MB' : size.megabytes.toLocaleString() + ' MB';
}

function createToggleButton(text, onClick) {
    const btn = document.createElement('span');
    btn.className = 'toggle-btn';
    btn.textContent = text;
    btn.onclick = onClick;
    return btn;
}

function populateTable(data) {
    const tableBody = document.getElementById('tableBody');
    tableBody.innerHTML = '';
    
    const layers = data.layers || {};
    
    Object.entries(layers).forEach(([layerName, layerInfo], layerIndex) => {
        // Layer row
        const layerRow = document.createElement('tr');
        layerRow.className = 'layer-row';
        const layerCell = document.createElement('td');
        layerCell.colSpan = 4;
        
        const layerToggleBtn = createToggleButton('+', (event) => {
            event.stopPropagation();
            const isExpanding = layerToggleBtn.textContent === '+';
            layerToggleBtn.textContent = isExpanding ? '-' : '+';
            
            const packageRows = document.querySelectorAll('[data-layer-id="' + layerIndex + '"].package-row');
            packageRows.forEach(row => {
                row.classList.toggle('hidden', !isExpanding);
                if (!isExpanding) {
                    const pkgBtn = row.querySelector('.toggle-btn');
                    if (pkgBtn) pkgBtn.textContent = '+';
                    const pkgName = row.getAttribute('data-package-name');
                    if (pkgName) {
                        document.querySelectorAll('.ipk-row[data-package="' + pkgName + '"]')
                            .forEach(ipkRow => ipkRow.classList.add('hidden'));
                    }
                }
            });
        });
        
        layerCell.appendChild(layerToggleBtn);
        layerCell.appendChild(document.createTextNode(
            layerName + ' (' + Object.keys(layerInfo.packages || {}).length + ' packages, ' + formatSize(layerInfo.total_size) + ')'
        ));
        
        layerRow.appendChild(layerCell);
        tableBody.appendChild(layerRow);

        // Package rows
        const packages = layerInfo.packages || {};
        Object.entries(packages).forEach(([packageName, packageInfo]) => {
            const packageRow = document.createElement('tr');
            packageRow.className = 'package-row hidden';
            packageRow.setAttribute('data-layer-id', layerIndex);
            packageRow.setAttribute('data-package-name', packageName);
            
            const nameCell = document.createElement('td');
            const packageToggleBtn = createToggleButton('+', (event) => {
                event.stopPropagation();
                const isExpanding = packageToggleBtn.textContent === '+';
                packageToggleBtn.textContent = isExpanding ? '-' : '+';
                
                const ipkRows = document.querySelectorAll('.ipk-row[data-package="' + packageName + '"]');
                ipkRows.forEach(row => {
                    row.classList.toggle('hidden', !isExpanding);
                });
            });
            
            nameCell.appendChild(packageToggleBtn);
            nameCell.appendChild(document.createTextNode(packageName));
            
            const archCell = document.createElement('td');
            archCell.textContent = packageInfo.manifest_info.arch;
            
            const versionCell = document.createElement('td');
            versionCell.textContent = packageInfo.manifest_info.version;
            
            const sizeCell = document.createElement('td');
            sizeCell.className = 'size-cell';
            sizeCell.textContent = formatSize(packageInfo.total_size);
            
            packageRow.appendChild(nameCell);
            packageRow.appendChild(archCell);
            packageRow.appendChild(versionCell);
            packageRow.appendChild(sizeCell);
            
            tableBody.appendChild(packageRow);

            // IPK rows
            const ipkFiles = packageInfo.ipk_files || {};
            Object.entries(ipkFiles).forEach(([ipkName, ipkInfo]) => {
                const ipkRow = document.createElement('tr');
                ipkRow.className = 'ipk-row hidden';
                ipkRow.setAttribute('data-layer-id', layerIndex);
                ipkRow.setAttribute('data-package', packageName);
                
                const nameCell = document.createElement('td');
                nameCell.style.paddingLeft = '60px';
                nameCell.textContent = ipkName;
                
                const emptyCell1 = document.createElement('td');
                const emptyCell2 = document.createElement('td');
                
                const sizeCell = document.createElement('td');
                sizeCell.className = 'size-cell';
                sizeCell.textContent = formatSize(ipkInfo.size);
                
                ipkRow.appendChild(nameCell);
                ipkRow.appendChild(emptyCell1);
                ipkRow.appendChild(emptyCell2);
                ipkRow.appendChild(sizeCell);
                
                tableBody.appendChild(ipkRow);
            });
        });
    });

    // Add total size row
    const totalRow = document.createElement('tr');
    totalRow.style.fontWeight = 'bold';
    totalRow.style.backgroundColor = '#e9ecef';
    totalRow.innerHTML = '<td colspan="3">Total Size:</td><td class="size-cell">' + formatSize(data.total_size) + '</td>';
    tableBody.appendChild(totalRow);
}

// Populate table immediately since data is embedded
populateTable(data);
</script>
